        [TestClass]
        class recordTypeTests
        {
            [TestMethod]
            static void DrugRecord()
            {
                MotDrugRecord r;
                MotSocket p;

                try
                {
                    p = new MotSocket("localhost", 24042);
                    r = new MotDrugRecord("Add");

                    // Null is a valid value
                    r.RxSys_DrugID = null;
                    r.LabelCode = null;
                    r.ProductCode = null;
                    r.TradeName = null;
                    r.Strength = 900000;
                    r.Unit = null;
                    r.RxOTC = null;
                    r.DoseForm = null;
                    r.Route = null;
                    r.DrugSchedule = 0;
                    r.VisualDescription = null;
                    r.DrugName = null;
                    r.ShortName = null;
                    r.NDCNum = null;
                    r.SizeFactor = 0;
                    r.Template = null;
                    r.DefaultIsolate = 0;
                    r.ConsultMsg = null;
                    r.GenericFor = null;
                    r.Write(p);

                    // Now use some actual values
                    r.RxSys_DrugID = "ABDC12579";
                    r.LabelCode = "Mumble";
                    r.ProductCode = "1234";
                    r.TradeName = "ALPHAFROG@ 120 MG Tablet";
                    r.Strength = 12.5;
                    r.Unit = "MG";
                    r.RxOTC = "R";
                    r.DoseForm = "Tablet";
                    r.Route = "Oral";
                    r.DrugSchedule = 6;
                    r.VisualDescription = "RND/RED/TAB";
                    r.DrugName = "ALPHAFROG@ 120 MG";
                    r.ShortName = "HAL 120MG";
                    r.NDCNum = "00023-0337-01";
                    r.SizeFactor = 5;
                    r.Template = "C";
                    r.DefaultIsolate = 0;
                    r.ConsultMsg = "Don't set your hair on fire";
                    r.GenericFor = "N/A";
                    r.Write(p);

                    // Change the record slightly
                    r.SetField("Action", "Change");
                    r.SetField("TradeName", "BetaDog");
                    r.SetField("DrugName", "BETADOG@ 12MG");
                    r.SetField("ProductCode", null);
                    r.SetField("GenericFor", null);
                    r.Write(p);

                    // Delete the ecord
                    r.SetField("Action", "Delete");
                    r.Write(p);
                }
                catch (Exception e)
                {
                    Console.Write("testDrug Record Failure {0}", e.Message);
                }
            }

